import React from 'react'
import { Table, Container } from 'semantic-ui-react'

const TableData = ({data}) => {

    const keys = Object.keys(data[0]);
    const displayHeaders = keys.map( (head, i) => {
        return(
            <Table.HeaderCell key={i} >{head}</Table.HeaderCell>
        );
    });

    const displayBody = data.map( obj => {
        for(const i in keys){ console.log(obj[0])}
        return("Hello")
    });


    return (
        <Container>
              <Table striped>
                <Table.Header>
                    <Table.Row>
                        {displayHeaders}
                    </Table.Row>
                </Table.Header>

                <Table.Body>
                    <Table.Row>
                        {displayBody}
                    </Table.Row>
                </Table.Body>
            </Table>
        </Container>
    );
}

export default TableData;
